import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Extract all product prices
    const productPrices = await page.$$eval('.product-card .product-price', priceElements => {
      return priceElements.map(el => {
        // Remove original price span if present and get main price text
        const clone = el.cloneNode(true);
        const originalPrice = clone.querySelector('.original-price');
        if (originalPrice) originalPrice.remove();
        return clone.textContent.trim();
      });
    });

    // Extract product titles for context
    const productTitles = await page.$$eval('.product-card .product-title', titleElements => {
      return titleElements.map(el => el.textContent.trim());
    });

    // Combine titles and prices into extracted data
    const extractedData = {};
    productTitles.forEach((title, index) => {
      extractedData[title] = productPrices[index];
    });

    // Take screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices_extracted.png'));

    return {
      success: true,
      action: "Extracted all product prices from the page",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
